import background from './assets/home-background.png';
import Navbar from './components/Navbar.js';
import './App.css';

function App() {
  return (
    <div className="App">
        <Navbar/>
        <img src={background} className="landing-background-image" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
    </div>
  );
}

export default App;
